import React from "react";
import Navbar from "../NavBar/Navbar";
import Footer from "../Footer/Footer";
import ProfileTab from "../ProfileTab/ProfileTab";

const Profilepage = () => {
  return (
    <>
      <Navbar />
      <ProfileTab />
      <Footer />
    </>
  );
};

export default Profilepage;
